import "./register.css"
import logo from "./assets/lg.png"

export default function Register() {
    const [values, setValues] = React.useState({
        password: "",
        showPassword: false,
      });
      
      const handleClickShowPassword = () => {
        setValues({ ...values, showPassword: !values.showPassword });
      };
      
      const handleMouseDownPassword = (event) => {
        event.preventDefault();
      };
      
      const handlePasswordChange = (prop) => (event) => {
        setValues({ ...values, [prop]: event.target.value });
      };
  return (
    <div className="register-h">
      <div className="container-md">
        <div className="logo">
          <img className="lib-lg" src={logo} alt="" />
          <span className="txt-lg">
            <b>eLibrary</b>
          </span>
        </div>
      </div>

      <div className="container">
        <p className="register">
          <b>register</b>
        </p>
        <form class="row g-3">
        <div class="col-md-4">
            <label for="inputFirstName" class="form-label">
              First Name
            </label>
            <input type="name" class="form-control" id="inputEmail4" />
          </div>
          <div class="col-md-4">
            <label for="inputLastName" class="form-label">
              Last Name
            </label>
            <input type="name" class="form-control" id="inputEmail4" />
          </div>
          <div class="row-md-6">
            <label for="inputEmail4" class="form-label">
              Email
            </label>
            <input type="email" class="form-control" id="inputEmail4" />
          </div>
          <div class="col-md-4">
            <label for="inputPassword4" class="form-label">
              Password
            </label>
            <Input
        type={values.showPassword ? "text" : "password"}
        onChange={handlePasswordChange("password")}
        value={values.password}
        endAdornment={
          <InputAdornment position="end">
            <IconButton
              onClick={handleClickShowPassword}
              onMouseDown={handleMouseDownPassword}
            >
              {values.showPassword ? <Visibility /> : <VisibilityOff />}
            </IconButton>
          </InputAdornment>
        }
      /><i className="eye far fa-eye"></i>
          </div>
          <div class="col-md-4">
            <label for="inputPassword4" class="form-label">
              Confirm Password
            </label>
            <input type="password" class="form-control" id="inputPassword4" /><i className="eye far fa-eye"></i>
          </div>

          <div class="row-12">
            <div class="form-check">
              <input class="form-check-input" type="checkbox" id="gridCheck" required />
              <label class="form-check-label" for="gridCheck">
                You accept our terms of service by ticking this box
              </label>
            </div>
          </div>
          <div class="col-12">
            <button type="submit" class="btnn btn-primary">
              Sign in
            </button>
          </div>
        </form>
      </div>
    
    </div>
  );
}
